import React from 'react'
import TelphonImg from '../../assets/img/telephone.png'
import WhatsApp from '../../assets/img/whatsapp.png'
import TelegramImg from '../../assets/img/telegram.png'
import EmailImg from '../../assets/img/email10.png'

const Contactus = () => {
  const contacts = [
    { imgSrc: TelphonImg, alt: "Telephone", number: "+374 33 55 75 65" },
    { imgSrc: WhatsApp, alt: "WhatsApp", number: "+374 33 55 75 65" },
    { imgSrc: TelegramImg, alt: "Telegram", number: "+374 33 55 75 65" },
    { imgSrc: EmailImg, alt: "Email", number: "info@example.com" }
  ];

  return (
    <section className="bg-secondary text-light p-md-5 p-4 text-center">
      <div className="container">
        <h1 className="mb-5 pt-md-0 pt-0 text-uppercase">Contact us</h1>
        {contacts.map((contact, index) => (
          <div className="row mb-md-5 mb-3 gap-3" key={index}>
            <div className="col-md" style={{ animationDelay: `${index * 0.5}s` }}>
              <div className="card-animation bg-warning item_contact">
                <img
                  src={contact.imgSrc}
                  alt={contact.alt}
                  className="icon_size"
                />
                <a className="text_black">{contact.number}</a>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Contactus;
